package com.bibinet.intelibuild.project.builder;/** * Created by bibinet on 2018-1-9. */public class OcrMessageEvent {    private String productName;    private String productNumber;    private String checkProject;    private String doStand;    public OcrMessageEvent(String productName, String productNumber, String checkProject, String doStand) {        this.productName = productName;        this.productNumber = productNumber;        this.checkProject = checkProject;        this.doStand = doStand;    }    public String getProductName() {        return productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public String getProductNumber() {        return productNumber;    }    public void setProductNumber(String productNumber) {        this.productNumber = productNumber;    }    public String getCheckProject() {        return checkProject;    }    public void setCheckProject(String checkProject) {        this.checkProject = checkProject;    }    public String getDoStand() {        return doStand;    }    public void setDoStand(String doStand) {        this.doStand = doStand;    }}